import React from "react";

class Reservation extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            name: new Date()

        };
    }
    render(){
        return(
            <table class="table table-success table-striped-columns">
                 <thead>
                        <tr>
                        <th scope="col">반려동물 이름</th>
                        <th scope="col"></th>1
                        <th scope="col">2</th>
                        <th scope="col">3</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                        <th scope="row">반려동물 종류</th>
                        <td>Mark</td>
                        <td>Otto</td>
                        <td>@mdo</td>
                        </tr>
                        <tr>
                        <th scope="row">반려동물 성별</th>
                        <td>Jacob</td>
                        <td>Thornton</td>
                        <td>@fat</td>
                        </tr>
                        <tr>
                        <th scope="row">요청사항</th>
                        <td colspan="2">Larry the Bird</td>
                        <td>@twitter</td>
                        </tr>
                    </tbody>
            </table>
        )
    }
        
}
export default Reservation;
